/***处理产品品名
 * @param $product_name
 * @param $goods_type
 * @param $index
 * @param $delivery_notpassed
 * @return mixed|string
 */
 function disposeProductName($x_product_name,$goods_type,$index, $delivery_notpassed)
{

    /**无法正常创建订单的处理*****/
    if($delivery_notpassed && 1 == $delivery_notpassed){
        $x_product_name = getProductName($index);
        if(!$x_product_name) {
            $x_product_name =  " Kids Shirt ".$index;
        }
    }else{
        $label_name = getProductTypeLabelName();
        $label_keys = array_keys($label_name);
        $p_name = null;
        foreach($label_keys as $key) {
            if (!(strpos($x_product_name, $key) === false)) {
                $p_name = $label_name[$key];
                break;
            }
        }
        $x_product_name =  $p_name ? $p_name:getProductName($index);
    }
    if(!$x_product_name){
        $x_product_name = " Kids Shirt";
    }
    /***替换掉特殊符号****/
    return str_replace("'"," ",str_replace('/'," ",str_replace('"'," ",str_replace("&","",$x_product_name))));
}



/***处理产品中品名
 * @param $product_name
 * @param $goods_type
 * @param $index
 * @param $delivery_notpassed
