    if($delivery_notpassed && 1 == $delivery_notpassed){
        $x_product_name = getProductName($index);
        if(!$x_product_name) {
            $x_product_name =  " Kids Shirt ".$index;
        }
    }else{
        $label_name = getProductTypeLabelName();
        $label_keys = array_keys($label_name);
        $p_name = null;
        foreach($label_keys as $key) {
            if (!(strpos($x_product_name, $key) === false)) {
                $p_name = $label_name[$key];
                break;
            }
        }
        $index_rand= rand(0,21);
        $x_product_name =  $p_name ? getProductChinaName($index_rand):getProductChinaName($index);
    }
    if(!$x_product_name){
        $x_product_name = "童装衬衫";
    }
    /***替换掉特殊符号****/
    return str_replace("'"," ",str_replace('/'," ",str_replace('"'," ",str_replace("&","",$x_product_name))));
}
